import Header from "./Componets/Header/Header";
import Home from "./Container/Home/Home";

function App() {
  return (
    <>
    <Header/>
    <switch>
      <root exact path={"/"} Component={Home}/>
      <root/>
    </switch>
    <Footer/>
    </>
  );
}

export default App;
